import React from 'react';
import logo from './../Source/logo.png';
import './../App.css';
import './Footer.css'
const Footer = () => 
{
    return(
        <div className='footer'>
        <div className='logo'>
        <img src={logo} />
        </div>
        </div>
    )
}

export default Footer;
